// import React from 'react';
import TaskList from './TaskList';

const GetTask = (props) => {
  return props.tasks.map((task) => (
    <TaskList
      id={task.id}
      title={task.taskTitle}
      endDate={task.taskEndDate}
      fetch={props.getData}
    />
  ));
};

export default GetTask;
